import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './style.scss';
class Menu extends Component {
  render() {
    return (
      <div className="menu-list">
        <ul>
          <a href=""></a><li>About Me</li>
          <li>Projects</li>
          <li>Skills</li>
          <li>Experience</li>
          <li>Contacts</li>
        </ul>
      </div>
    );
  }
}

export default Menu;
